import React from 'react';
import ReactDOM from 'react-dom';

function myList() {
    return ['Yes', 'No', 'Maybe'];
}

function listify(s) {
    return <li>{ s }</li>
}

function MyApp() {
    return (
    <ul>
        { listify(myList()[0]) }
    </ul>
    )
}

ReactDOM.render(<MyApp />, document.getElementById("root"));
